style.css:
@-moz-document domain(tumblr.com) {
#logout_button.tab.iconic > a,
#logout_button.tab.iconic > a {
  background: url("http://static.tumblr.com/noof89y/wShmmsqjn/tumblr_mkwsfdlxv71s22g4vo1_500.gif") !important;
  background-size: 35px 36px !important;
}

#logout_button.tab.iconic > a:hover  {
  opacity: .85 !important;
  -moz-transition: ease-out all .25s !important;
}

#logout_button.tab.iconic.selected > a {
  opacity: 1 !important;
  -moz-transition: ease-out all .25s !important;
}
}
